import React, { useState, useEffect } from 'react';
import { Container, Title, ListPurchases } from '../../component/indexPurchases';
import FindByAllPurchases from './FindByAllPurchases';
import { useNavigation } from '@react-navigation/native';
import Api from '../../services';
import { AntDesign } from '@expo/vector-icons';

interface PurchasesData {
	id: number;
	purchase: string;
	pricePurchase: number;
	pieceQuantity: number;
	payment: number;
	installment: number;
  valueToSell: number;
  profit: number;
}

export default function Purchases() {
	const navigation = useNavigation();
	const [ purchases, setPurchases ] = useState<PurchasesData[]>([]);

	useEffect(()=> {
		Api.get<PurchasesData[]>('/purchase')
		.then(response => {
			setPurchases(response.data.Purchases);
		})
	}, [])

	return (
		<Container>
			<ListPurchases
			data = { purchases } keyExtractor = { purchase => purchase.id }
			renderItem = {({purchase}) => (
				<FindByAllPurchases />
			)} />
		</Container>
	);
}
